import React from 'react'
import img1 from '../assets/img-1.png';
const Products = () => {
  const products = [
    {
      image: img1,
      title: "Green Dress",
      price: 25.99,
      link: "/products/1",
    },
  ]
  return (
    <>
      <Navbar />
      <Filters />
      <Section array={products} />

      <Footer />
    </>
  );
};

export default Products
